parameters.inputSchema:
{
  "type": "object",
  "properties": {
    "event_id": {
      "type": "string",
      "description": "Event ID of the professional for which you want to check availability"
    },
    "startTime": {
      "type": "string",
      "format": "date-time",
      "description": "Start date and time of the appointment in ISO 8601 format (e.g., '2024-11-18T08:00:00Z')"
    },
    "endTime": {
      "type": "string",
      "format": "date-time",
      "description": "End date and time of the appointment in ISO 8601 format. If not provided, the default will be 24 hours after 'startTime'. If provided, the end time must be within 3 days of the 'startTime'."
    }
  },
  "required": [
    "event_id",
    "startTime",
    "endTime"
  ]
}

